import { IonButton, IonCol, IonGrid, IonInput, IonItem, IonLabel, IonRow } from "@ionic/react";
import React, { useState } from "react";

const MultiForm: React.FC<{ buttonName: string, type: "agent" | "complex" | "package" | "promotion" }> = (props) => {
  const [isAgent, setIsAgent] = useState<Boolean>(false);
  const [isComplex, setIsComplex] = useState<Boolean>(false);
  const [isPackage, setIsPackage] = useState<Boolean>(false);
  const [isPromotion, setIsPromotion] = useState<Boolean>(false);

  const stateHandler = () =>{
    if (props.type === "agent"){
      setIsAgent(true);
      return(isAgent);
    }
    else if (props.type === "package"){
      setIsPackage(true);
      return(isPackage);
    }
    else if (props.type === "promotion"){
      setIsPromotion(true);
      return(isPromotion)
    }
    else{
      setIsComplex(true);
      return(isComplex);
    }
  };

  let agentForm = <h2>agent form</h2>;
  let complexForm = <h2> complex form</h2>;
  let packageForm = <h2> complex form</h2>;
  let promotionForm = <h2> complex form</h2>;

  return (
    <IonGrid>
      {isAgent ? {agentForm} : isComplex ? {complexForm} : isPackage ? {packageForm}: {promotionForm}}
      <IonRow>
        <IonCol>
            <IonItem>
                <IonLabel position="floating">Name</IonLabel>
                <IonInput></IonInput>
            </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
            <IonItem>
                <IonLabel position="floating">Surname</IonLabel>
                <IonInput></IonInput>
            </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
            <IonItem>
                <IonLabel position="floating">ID</IonLabel>
                <IonInput></IonInput>
            </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
            <IonItem>
                <IonLabel position="floating">Cell Number</IonLabel>
                <IonInput></IonInput>
            </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel position="floating">Street 1</IonLabel>
            <IonInput></IonInput>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel position="floating">Street 2</IonLabel>
            <IonInput></IonInput>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel position="floating">City</IonLabel>
            <IonInput></IonInput>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel position="floating">Province</IonLabel>
            <IonInput></IonInput>
          </IonItem>
        </IonCol>
        <IonCol>
          <IonItem>
            <IonLabel position="floating">Postal code</IonLabel>
            <IonInput></IonInput>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel position="floating">Complex</IonLabel>
            <IonInput></IonInput>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonButton type="submit" expand="block">{props.buttonName}</IonButton>
        </IonCol>
      </IonRow>
    </IonGrid>
  );
};

export default MultiForm;
